function HomePage() {



    return (
        <div className="mx-8 lg:mx-32">
            <Header name={"Marianna"}/>
            <div className="flex justify-between">
                {inputs.categories.map(cat => <Category name={cat.name} bg={cat.color} cells={cat.cells}/>)}
            </div>

        </div>
    )
}

export default HomePage
